(()=>{"use strict";var e,t={272:(e,t,a)=>{var n=a(1489);const i=a.p+"assets/WT Connection-a2a822b8498674174dd8.glb",s=a.p+"assets/WT Connection -- Tensile rupture-a8299c5f16176a11f34e.glb",r=a.p+"assets/WT Connection -- Web block shear-b2d4cad06acbe27978b9.glb",l=a.p+"assets/WT Connection -- Intuitive block shear-2052847a871ce08a3582.glb",o=a.p+"assets/WT Connection -- Unlikely block shear-faf16732d7bcb2abb2f6.glb",p=`<figure> <img src="${new URL(a(5955),a.b)}"/> </figure> `,h=`<h1 id="calculations">Calculations</h1> <p>This page demonstrates calculations to determine the design strength of the WT tension member, considering the limit states of:</p> <ul> <li>Tensile yielding</li> <li>Tensile rupture</li> <li>Block shear rupture</li> </ul> <p>The calculations are based on the 2022 AISC <em>Specification</em> and the 16th edition AISC <em>Manual</em>.</p> <h2 id="material-and-geometric-properties">Material and Geometric Properties</h2> <p>The connection consists of a WT8x25 with the flange connected by six (6) 1" diameter A490X bolts to a 1" plate.</p> <figure> <img src="${new URL(a(5955),a.b)}" alt=""/><figcaption>Structural drawing</figcaption> </figure> <p>Typically, the material specifications for each type of steel shape used on a project are listed on the general notes sheet of the structural drawings. For this case, the WT conforms to ASTM A992.</p> <p>From AISC <em>Manual</em> Table 2-4, the material properties for the WT are as follows:</p> <div class="properties"> <table> <tbody> <tr class="odd"> <td>ASTM A992</td> </tr> <tr class="even"> <td><span class="math inline">\\(F_y = 50\\ksi\\)</span></td> </tr> <tr class="odd"> <td><span class="math inline">\\(F_u = 65\\ksi\\)</span></td> </tr> </tbody> </table> </div> <p>From AISC <em>Manual</em> Table 1-8, the geometric properties are as follows:</p> <div class="properties"> <table> <tbody> <tr class="odd"> <td>WT8x25</td> <td></td> <td></td> </tr> <tr class="even"> <td><span class="math inline">\\(A_g = 7.37~{\\rm in.}^2\\)</span></td> <td><span class="math inline">\\(t_f = 0.630~{\\rm in.}\\)</span></td> <td><span class="math inline">\\(d = 8.13~{\\rm in.}\\)</span></td> </tr> <tr class="odd"> <td><span class="math inline">\\(\\bar{y} = 1.89~{\\rm in.}\\)</span></td> <td><span class="math inline">\\(b_f = 7.07~{\\rm in.}\\)</span></td> <td><span class="math inline">\\(t_w = 0.380~{\\rm in.}\\)</span></td> </tr> </tbody> </table> </div> <h2 id="tensile-yielding">Tensile Yielding</h2> <p>Calculate the nominal strength using AISC <em>Specification</em> Equation D2-1.</p> <p><span class="math display">\\[ \\begin{align} P_n &amp;= F_y A_g \\\\ &amp;= (50 \\text{ ksi})(7.37 \\text{ in.}^2) \\\\ &amp;= 368 \\text{ kips} \\end{align} \\]</span></p> <p>Calculate the design strength by applying the resistance factor.</p> <p><span class="math display">\\[ \\phi P_n = 0.9 (368 \\text { kips}) \\boxed{= 332 \\text{ kips}} \\]</span></p> <h2 id="tensile-rupture">Tensile Rupture</h2> <p>Steps:</p> <ul> <li>Calculate net area <span class="math inline">\\(A_n\\)</span></li> <li>Calculate shear lag factor <span class="math inline">\\(U\\)</span> and effective net area <span class="math inline">\\(A_e\\)</span></li> <li>Calculate tensile rupture strength</li> </ul> <p>A depiction of tensile rupture failure for this connection is shown in <a href="#Tensile-rupture">this three-dimensional view</a>.</p> <p>The net area, <span class="math inline">\\(A_n\\)</span>, is shown in red. It is equal to the gross area minus the material removed for two bolt holes as defined in Section B4.3b of the AISC <em>Specification</em>.</p> <figure> <img src="${new URL(a(5674),a.b)}" alt=""/><figcaption>Area in tension. Light areas are removed for net area.</figcaption> </figure> <p><span class="math display">\\[ \\begin{align} A_n &amp;= A_g - 2(d_h + \\tfrac{1}{16}\\text{ in.}) t_f \\\\ &amp;= 7.37 \\text{ in.}^2 - 2 (1 \\tfrac{1}{8} \\text{ in.} + \\tfrac{1}{16}\\text{ in.}) (0.630 \\text{ in.}) \\\\ &amp;= 5.87 \\text{ in.}^2 \\end{align} \\]</span></p> <p>From the description of the element in AISC <em>Specification</em> Table D3.1 Case 2, calculate the shear lag factor <span class="math inline">\\(U\\)</span> as the larger of the values from Case 2 and Case 7.</p> <p>Case 2, where:</p> <ul> <li><span class="math inline">\\(\\bar{x}\\)</span> is <span class="math inline">\\(\\bar{y}\\)</span> from AISC <em>Manual</em> Table 1-9.</li> <li><span class="math inline">\\(l\\)</span> is the length of the connection, in the direction of the force, from the centerline of the first row of bolts to the centerline of the last row of bolts</li> </ul> <figure> <img src="${new URL(a(879),a.b)}" alt=""/><figcaption>Figure showing <span class="math inline">\\(l\\)</span></figcaption> </figure> <p><span class="math display">\\[ \\begin{align} U &amp;= 1 - \\frac{\\bar{x}}{l} \\\\ &amp;= 1 - \\frac{1.89 \\text{ in.}}{6 \\text{ in.}} \\\\ &amp;= 0.685 \\end{align}\\]</span></p> <p>Case 7; flange has three fasteners per line in the direction of loading:</p> <p><span class="math display">\\[ \\begin{align} b_f &amp;= 7.07\\text{ in.} \\\\ \\tfrac23 d &amp;= \\tfrac23 (8.13\\text{ in.}) = 5.42\\text{ in.} \\\\ b_f &amp;\\ge \\tfrac23 d \\Rightarrow \\boxed{U = 0.90} \\end{align} \\]</span></p> <p>Use the larger <span class="math inline">\\(U = 0.90\\)</span>.</p> <p>Calculate the effective net area using AISC <em>Specification</em> Equation D3-1:</p> <p><span class="math display">\\[ A_e = A_n U = (5.87 \\text{ in.}^2) (0.90) = 5.29 \\text{ in.}^2 \\]</span></p> <p>Calculate the nominal strength using AISC <em>Specification</em> Equation D2-2:</p> <p><span class="math display">\\[ \\begin{align} P_n &amp;= F_u A_e \\\\ &amp;= (65 \\text{ ksi})(5.29 \\text{ in.}^2) \\\\ &amp;= 344 \\text{ kips} \\end{align} \\]</span></p> <p>Calculate the design strength by applying the resistance factor.</p> <p><span class="math display">\\[\\phi P_n = 0.75 (344 \\text{ kips}) \\boxed{= 258 \\text{ kips}}\\]</span></p> <h2 id="block-shear">Block Shear</h2> <p>There are three plausible block shear paths for this connection:</p> <ol type="1"> <li><a href="#Block-shear-1">Tension in the flange and shear in the stem</a></li> <li><a href="#Block-shear-2">Tension in the outside of the flange and shear along the bolt lines</a></li> <li><a href="#Block-shear-3">Tension in the stem and the inside of the flange and shear along the bolt lines</a></li> </ol> <p>All plausible paths have uniform tension stress, so <span class="math inline">\\(U_{bs} = 1.0\\)</span> for all.</p> <h3 id="block-shear-1-model">Block Shear 1 (<a href="#Block-shear-1">model</a>)</h3> <figure> <img src="${new URL(a(7792),a.b)}" alt=""/><figcaption>Area subject to shear in blue.</figcaption> </figure> <p>The shear plane is in the stem at the toe of the fillet. Since there is no material removed (e.g., bolt holes), the gross and net shear areas <span class="math inline">\\(A_{gv}\\)</span> and <span class="math inline">\\(A_{nv}\\)</span> are the same:</p> <p><span class="math display">\\[ \\begin{align} A_{gv} = A_{nv} &amp;= t_w (8 \\text{ in.}) \\\\ &amp;= (0.380 \\text{ in.})(8 \\text{ in.}) \\\\ &amp;= 3.04 \\text{ in.}^2 \\end{align} \\]</span></p> <p>The gross area subject to tension is most easily calculated by subtracting the area of the stem from the gross area of the WT:</p> <figure> <img src="${new URL(a(7757),a.b)}" alt=""/><figcaption>Area subject to tension in red. Light areas are removed for net area.</figcaption> </figure> <p><span class="math display">\\[ \\begin{align} A_{gt} &amp;= A - t_w (d - k_{des}) \\\\ &amp;= 7.37 \\text{ in.}^2 - (0.380 \\text{ in.})( 8.13 \\text{ in.} - 1.03 \\text{ in.}) \\\\ &amp;= 4.67 \\text{ in.}^2 \\end{align} \\]</span></p> <p>Calculate the net area subject to tension.</p> <p><span class="math display">\\[ \\begin{align} A_{nt} &amp;= A_{gt} - 2(d_h + \\tfrac{1}{16}\\text{ in.}) t_f \\\\ &amp;= 4.67 \\text{ in.}^2 - 2 (1 \\tfrac{1}{8} \\text{ in.} + \\tfrac{1}{16}\\text{ in.}) (0.630 \\text{ in.}) \\\\ &amp;= 3.18 \\text{ in.}^2 \\end{align} \\]</span></p> <p>Calculate the nominal strength using AISC <em>Specification</em> Equation J4-5. Since <span class="math inline">\\(A_{gv} = A_{nv}\\)</span>, the strength with shear yield will control over the strength with shear rupture.</p> <p><span class="math display">\\[ \\begin{align} R_n &amp;= 0.60 F_y A_{gv} + U_{bs} F_u A_{nt} \\\\ &amp;= 0.60 (50\\text{ ksi})(3.04\\text{ in.}^2) + 1.0 (65\\text{ ksi}) (3.18 \\text{ in.}^2)\\\\ &amp;\\boxed{= 298 \\text{ kips}} \\end{align} \\]</span></p> <h3 id="block-shear-2-model">Block Shear 2 (<a href="#Block-shear-2">model</a>)</h3> <figure> <img src="${new URL(a(4071),a.b)}" alt=""/><figcaption>Block shear path 2.</figcaption> </figure> <p>Calculate the gross area subject to shear.</p> <figure> <img src="${new URL(a(1445),a.b)}" alt=""/><figcaption>Area subject to shear in blue. Light areas are removed for net area.</figcaption> </figure> <p><span class="math display">\\[ \\begin{align} A_{gv} &amp;= 2 t_f (8 \\text{ in.}) \\\\ &amp;= 2 (0.630 \\text{ in.}) (8 \\text{ in.}) \\\\ &amp;= 10.1 \\text{ in.}^2 \\end{align} \\]</span></p> <p>Calculate the net area by removing the material from 4 whole bolt holes and 2 half bolt holes.</p> <p><span class="math display">\\[ \\begin{align} A_{nv} &amp;= A_{gv} - 5 (d_h + \\tfrac{1}{16}\\text{ in.}) t_f \\\\ &amp;= 10.1 \\text{ in.}^2 - 5 (1 \\tfrac18 \\text{ in.} + \\tfrac{1}{16}\\text{ in.}) (0.630 \\text{ in.}) \\\\ &amp;= 6.34 \\text{ in.}^2 \\end{align} \\]</span></p> <p>Calculate the gross area subject to tension.</p> <figure> <img src="${new URL(a(3728),a.b)}" alt=""/><figcaption>Area subject to tension in red. Light areas are removed for net area.</figcaption> </figure> <p><span class="math display">\\[ \\begin{align} A_{gt} &amp;= (b_f - 3.5\\text{ in.}) t_f \\\\ &amp;= (7.07\\text{ in.} - 3.5\\text{ in.}) (0.630 \\text{ in.}) \\\\ &amp;= 2.25 \\text{ in.}^2 \\end{align} \\]</span></p> <p>Calculate the net area subject to tension.</p> <p><span class="math display">\\[ \\begin{align} A_{nt} &amp;= A_{gt} - (d_h + \\tfrac{1}{16}\\text{ in.}) t_f \\\\ &amp;= 2.25 \\text{ in.}^2 - (1 \\tfrac18 \\text{ in.} + \\tfrac{1}{16}\\text{ in.}) (0.630 \\text{ in.}) \\\\ &amp;= 1.50 \\text{ in.}^2 \\end{align} \\]</span></p> <p>Calculate the nominal block shear strength.</p> <p><span class="math display">\\[ \\begin{align} R_n &amp;= 0.60 F_u A_{nv} + U_{bs} F_u A_{nt} \\le 0.60 F_y A_{gv} + U_{bs} F_u A_{nt} \\\\ &amp;= 0.60 (65\\text{ ksi}) (6.34 \\text{ in.}^2) + 1.0 (65\\text{ ksi}) (1.50 \\text{ in.}^2) \\\\ &amp;\\quad\\le 0.60 (50\\text{ ksi}) (10.1 \\text{ in.}^2) + 1.0 (65\\text{ ksi}) (1.50 \\text{ in.}^2) \\\\ &amp;= 247\\text{ kips} + 97.5\\text{ kips} \\le 303\\text{ kips} + 97.5\\text{ kips} \\\\ &amp;\\boxed{= 345\\text{ kips}} \\end{align} \\]</span></p> <h3 id="block-shear-3-model">Block Shear 3 (<a href="#Block-shear-3">model</a>)</h3> <figure> <img src="${new URL(a(5684),a.b)}" alt=""/><figcaption>Block shear path 3.</figcaption> </figure> <p>The gross and net areas subject to shear are the same as for block shear 2.</p> <p><span class="math display">\\[ \\begin{align} A_{gv} &amp;= 10.1 \\text{ in.}^2\\\\ A_{nv} &amp;= 6.34 \\text{ in.}^2 \\end{align} \\]</span></p> <p>Calculate the gross area subject to tension.</p> <figure> <img src="${new URL(a(1131),a.b)}" alt=""/><figcaption>Area subject to tension in red. Light areas are removed for net area.</figcaption> </figure> <p><span class="math display">\\[ \\begin{align} A_{gt} &amp;= A - (b_f - 3.5\\text{ in.}) t_f \\\\ &amp;= 7.37 \\text{ in.}^2 - (7.07\\text{ in.} - 3.5\\text{ in.}) (0.630 \\text{ in.}) \\\\ &amp;= 5.12 \\text{ in.}^2 \\end{align} \\]</span></p> <p>Calculate the net area subject to tension.</p> <p><span class="math display">\\[ \\begin{align} A_{nt} &amp;= A_{gt} - (d_h + \\tfrac{1}{16}\\text{ in.}) t_f \\\\ &amp;= 5.12 \\text{ in.}^2 - (1 \\tfrac18 \\text{ in.} + \\tfrac{1}{16}\\text{ in.}) (0.630 \\text{ in.}) \\\\ &amp;= 4.37 \\text{ in.}^2 \\end{align} \\]</span></p> <p>Calculate the nominal block shear strength.</p> <p><span class="math display">\\[ \\begin{align} R_n &amp;= 0.60 F_u A_{nv} + U_{bs} F_u A_{nt} \\le 0.60 F_y A_{gv} + U_{bs} F_u A_{nt} \\\\ &amp;= 0.60 (65\\text{ ksi}) (6.34 \\text{ in.}^2) + 1.0 (65\\text{ ksi}) (5.12 \\text{ in.}^2) \\\\ &amp;\\quad\\le 0.60 (50\\text{ ksi}) (10.1 \\text{ in.}^2) + 1.0 (65\\text{ ksi}) (5.12 \\text{ in.}^2) \\\\ &amp;= 247\\text{ kips} + 333\\text{ kips} \\le 303\\text{ kips} + 333\\text{ kips} \\\\ &amp;\\boxed{= 531\\text{ kips}} \\end{align} \\]</span></p> <h3 id="block-shear-summary">Block Shear Summary</h3> <p>The controlling nominal strength is from block shear 1, with <span class="math inline">\\(R_n = 298\\text{ kips}\\)</span>. Calculate the design strength by applying the resistance factor.</p> <p><span class="math display">\\[ \\begin{align} \\phi R_n &amp;= 0.75 (298\\text{ kips}) \\\\ &amp;\\boxed{= 223\\text{ kips}} \\end{align} \\]</span></p> <h2 id="limit-state-summary">Limit State Summary</h2> <p>The design tensile strength of the WT member is summarized in the following table.</p> <table> <caption>Tensile limit state summary</caption> <thead> <tr class="header"> <th style="text-align:left">Limit state</th> <th style="text-align:right">Design strength</th> </tr> </thead> <tbody> <tr class="odd"> <td style="text-align:left">Tensile yielding</td> <td style="text-align:right">332 kips</td> </tr> <tr class="even"> <td style="text-align:left">Tensile rupture</td> <td style="text-align:right">258 kips</td> </tr> <tr class="odd"> <td style="text-align:left">Block shear rupture</td> <td style="text-align:right">223 kips</td> </tr> </tbody> </table> <p><strong>Block shear rupture controls with a design strength of 223 kips.</strong></p> `,c=`<p>What would be the controlling limit state if the tension member was a WT6x25?</p> <hr/> <p>WTs are made by cutting a wide-flange section lengthwise, either in a dedicated shop or at the jobsite itself. They are rarely, if ever, hot-rolled as separate sections. The cut can be achieved in a variety of ways. Due to residual stresses in the W section, the two pieces will actually bend and may need to be straightened:</p> <figure> <img src="${new URL(a(6067),a.b)}" alt=""/><figcaption>Bending of tee as the source W section is cut. [<a href="https://www.youtube.com/watch?v=x3qNUgCmbDY">Source</a>]</figcaption> </figure> <hr/> <p>The block shear pattern with <a href="#Block-shear-1">tension in the flange and shear in the stem</a> is a bit out of the ordinary. The AISC <em>Engineering Journal</em> published papers that discuss this sort of failure in <a href="https://www.aisc.org/Block-Shear-of-Structural-Tees-in-Tension-Alternate-Paths">1996</a> and <a href="https://www.aisc.org/Block-Shear-Net-Section-Capacities-of-Struct-Tees-in-Tension-Test-Results-Code-Implications">2002</a>.</p> <hr/> <p>There are a lot of limit states even for this one connection. If you are unsure which controls, or if you are writing a design spreadsheet, it is a good idea to check them all. With experience, you will gain a feel for which limit states control a given connection and simplify your calculations.</p> <hr/> <p>What is the strength of the bolt group in this connection? Remember to consider bearing and tearout in the connected material as well as bolt shear rupture.</p> <hr/> <p>This connection has eccentricity – the centroid of the tension member is offset from the centroid of the gusset plate. As a result, moments are generated which may need to be considered in design. Historically, eccentricity has been ignored for tension members. It cannot be ignored for compression members.</p> <hr/> <p>Do you have a fun idea to add to this page? Learn how to contribute it in <a href="../docs/#Adding-a-more-fun-item">the documentation</a>.</p> `;new n.qw({title:"WT Bolted Connection",groups:[{name:"models",items:[new n.Kx({name:"3D model",path:i}),new n.Kx({name:"Tensile rupture",path:s}),new n.Kx({name:"Block shear 1",path:r,desc:"Tension in the flange and shear in the stem"}),new n.Kx({name:"Block shear 2",path:l,desc:"Tension in the outside of the flange and shear along the bolt lines"}),new n.Kx({name:"Block shear 3",path:o,desc:"Tension in the stem and the inside of the flange and shear along the bolt lines"})]},{name:"more",items:[new n.Xs({name:"2D structural drawing",content:p,classes:["full-width"]}),new n.Xs({name:"Calculations",content:h}),new n.Xs({name:"More fun!",content:c})]}],contributors:["Peter Talley","Mark Denavit"]})},6067:(e,t,a)=>{e.exports=a.p+"assets/bending-of-tee-when-cut-bad3e050231796b6d249.gif"},5955:(e,t,a)=>{e.exports=a.p+"assets/bolted-wt-top-3eb77d102b1abe01b36d.svg"},7792:(e,t,a)=>{e.exports=a.p+"assets/wt-block-shear-1-area-shear-4c8dd93bea6a87490794.svg"},7757:(e,t,a)=>{e.exports=a.p+"assets/wt-block-shear-1-area-tension-7f861d8c689c34e405b3.svg"},1445:(e,t,a)=>{e.exports=a.p+"assets/wt-block-shear-2-area-shear-40128aa4a304d1c52b49.svg"},3728:(e,t,a)=>{e.exports=a.p+"assets/wt-block-shear-2-area-tension-1fa2abd912db2e5abb72.svg"},4071:(e,t,a)=>{e.exports=a.p+"assets/wt-block-shear-2-path-b74cd27ce2d6b7df724e.svg"},1131:(e,t,a)=>{e.exports=a.p+"assets/wt-block-shear-3-area-tension-17af6c129f2617a31756.svg"},5684:(e,t,a)=>{e.exports=a.p+"assets/wt-block-shear-3-path-32a0fe8c7863773c785e.svg"},5674:(e,t,a)=>{e.exports=a.p+"assets/wt-rupture-area-25c67af1a3b2ff5aa44e.svg"},879:(e,t,a)=>{e.exports=a.p+"assets/wt-shear-lag-04e69230e3055469dcfb.svg"}},a={};function n(e){var i=a[e];if(void 0!==i)return i.exports;var s=a[e]={exports:{}};return t[e](s,s.exports,n),s.exports}n.m=t,e=[],n.O=(t,a,i,s)=>{if(!a){var r=1/0;for(h=0;h<e.length;h++){for(var[a,i,s]=e[h],l=!0,o=0;o<a.length;o++)(!1&s||r>=s)&&Object.keys(n.O).every((e=>n.O[e](a[o])))?a.splice(o--,1):(l=!1,s<r&&(r=s));if(l){e.splice(h--,1);var p=i();void 0!==p&&(t=p)}}return t}s=s||0;for(var h=e.length;h>0&&e[h-1][2]>s;h--)e[h]=e[h-1];e[h]=[a,i,s]},n.d=(e,t)=>{for(var a in t)n.o(t,a)&&!n.o(e,a)&&Object.defineProperty(e,a,{enumerable:!0,get:t[a]})},n.g=function(){if("object"==typeof globalThis)return globalThis;try{return this||new Function("return this")()}catch(e){if("object"==typeof window)return window}}(),n.o=(e,t)=>Object.prototype.hasOwnProperty.call(e,t),(()=>{var e;n.g.importScripts&&(e=n.g.location+"");var t=n.g.document;if(!e&&t&&(t.currentScript&&"SCRIPT"===t.currentScript.tagName.toUpperCase()&&(e=t.currentScript.src),!e)){var a=t.getElementsByTagName("script");if(a.length)for(var i=a.length-1;i>-1&&(!e||!/^http(s?):/.test(e));)e=a[i--].src}if(!e)throw new Error("Automatic publicPath is not supported in this browser");e=e.replace(/#.*$/,"").replace(/\?.*$/,"").replace(/\/[^\/]+$/,"/"),n.p=e})(),(()=>{n.b=document.baseURI||self.location.href;var e={679:0};n.O.j=t=>0===e[t];var t=(t,a)=>{var i,s,[r,l,o]=a,p=0;if(r.some((t=>0!==e[t]))){for(i in l)n.o(l,i)&&(n.m[i]=l[i]);if(o)var h=o(n)}for(t&&t(a);p<r.length;p++)s=r[p],n.o(e,s)&&e[s]&&e[s][0](),e[s]=0;return n.O(h)},a=self.webpackChunkaisc_model_viewer=self.webpackChunkaisc_model_viewer||[];a.forEach(t.bind(null,0)),a.push=t.bind(null,a.push.bind(a))})();var i=n.O(void 0,[321,489],(()=>n(272)));i=n.O(i)})();
